  02> CACCIA-BIRCH, William John m on 01.10.1958 to STEPTOE, Brenda Irene
  b 31.10.1931
  b 26.08.1935
  John b. at Marton and m. in England. Divorced Nov 1980.
  John was educated at Huntley School and Christ's College, Christchurch. He travelled to England where
  he met and married Brenda. They lived in Canada where John was a tree surgeon before returning to New
  Zealand and buying a hill-country sheep property, "Tutamoe" Station, Tolaga Bay. Later he was a
  bulldozing contractor in Gisborne before moving to Australia. He loves the outdoors and gardening. He
  is now living and working on an outback cattle station in southeast Queensland.
  Brenda's family came from Cornwall, England, but she lost her parents in the London blitz in WW2. She
  grew up in Wales and won the title of Miss Pembrokeshire in 1953. She was a staff nurse at Haverford
  Hospital in South Wales before her marriage and in later years she continued her nursing career at Cook ·
  Hospital, Gisborne, NZ.
