  Edward Hurley and Helen Murray McMillan, b. at Marton. Address: PO Box 1254, Lillooet, BC VOK IVO,
  Canada.
  Tony was educated at Huntley School, Marton and Nelson College. He was raised on "Tutamoe" station,
  Tolaga Bay and developed a love of wilderness, hunting and conservation, He now works as a
  professional hunter. Therese was educated at Campion College, Gisborne and Carmel College,
  Auckland. She was raised on "Hauiti" (formerly "Iwanui") station, Tolaga Bay and works as a clerk/
  typist/ receptionist.
